import React from 'react';
import { useRef } from 'react';

const New = () => {
  const inputRef = useRef();
  const clickHandler = () => {
    alert(inputRef.current.value);
  };

  return (
    <div>
      <form>
        <input ref={inputRef}></input>
        <button onClick={clickHandler}></button>
      </form>
    </div>
  );
};

export default New;
